class videoElement extends React.Component{
  render(){
    return (
    <div class="grid-container">
      <div >
        1
      </div>
      <div >2</div>
      <div >3</div>  
      <div >4</div>
      <div >5</div>
      <div >6</div>  
      <div >7</div>
      <div >8</div>
      <div >9</div>  
      <div >10</div>
      <div >11</div>
      <div >12</div>  
    </div>);
  }
} 

class App extends React.Component {
  render() {
    return (
      <div>
        <ReactPlayer
          // url='https://www.youtube.com/watch?v=35lXWvCuM8o'
          url={this.props.url}
          className='react-player'
          playing
          width='100%'
          height='100%'
        />
      </div>
    );
  }
}
const app = (<div>
  <ReactPlayer
     url='https://www.youtube.com/watch?v=35lXWvCuM8o'
    // url={this.props.url}
    className='react-player'
    playing
    width='100%'
    height='100%'
  />
</div>);
ReactDOM.render(
  videoElement,document.getElementById('root')
);


